import { Menu, Dropdown } from "antd";
import { useNavigate } from 'react-router-dom';
import "./index.css";



export default function Home() {

    returnBook = () => {
        console.log("归还书籍");
    }

    borrowBook = () => {
        console.log("借阅书籍");
    }

    presonCenter = () => {
        console.log("个人中心");
        const navigate = useNavigate();
        navigate('/person');
    }

    return (
        <div className="back">
            <div className="top-left">图书管理系统</div>
            <div className="top-person">
                <Dropdown
                    placement="topLeft"
                    overlay={
                    <Menu style={{ color: "red"}}>
                        <Menu.Item
                            className="menu-item"
                            key="1"
                            onClick={this.borrowBook}
                        >
                            借阅书籍
                        </Menu.Item>
                        <Menu.Item 
                            className="menu-item"
                            key="2"
                            onClick={this.returnBook}
                        >
                            归还书籍
                        </Menu.Item>
                        <Menu.Item 
                            className="menu-item"
                            key="3"
                            onClick={this.presonCenter}
                        >
                            个人中心
                        </Menu.Item>
                    </Menu>
                    }
                    trigger="hover"
                >
                    <p>用户名</p>
                </Dropdown>
            </div>
        </div>
    )
}
